Synchro/coolbru) \u003cphpmailer@synchromedia.co.uk\u003e"," * @author Jim Jagielski (jimjag) \u003cjimjag@gmail.com\u003e"," * @author Andy Prevost (codeworxtech) \u003ccodeworxtech@users.sourceforge.net\u003e"," * @author Brent R. Matzelle (original founder)"," */","class PHPMailer","{","    const CHARSET_ASCII = 'us-ascii';","    const CHARSET_ISO88591 = 'iso-8859-1';","    const CHARSET_UTF8 = 'utf-8';","","    const CONTENT_TYPE_PLAINTEXT = 'text/plain';","    const CONTENT_TYPE_TEXT_CALENDAR = 'text/calendar';","    const CONTENT_TYPE_TEXT_HTML = 'text/html';","    const CONTENT_TYPE_MULTIPART_ALTERNATIVE = 'multipart/alternative';","    const CONTENT_TYPE_MULTIPART_MIXED = 'multipart/mixed';","    const CONTENT_TYPE_MULTIPART_RELATED = 'multipart/related';","","    const ENCODING_7BIT = '7bit';","    const ENCODING_8BIT = '8bit';","    const ENCODING_BASE64 = 'base64';","    const ENCODING_BINARY = 'binary';","    const ENCODING_QUOTED_PRINTABLE = 'quoted-printable';","","    const ENCRYPTION_STARTTLS = 'tls';","    const ENCRYPTION_SMTPS = 'ssl';","","    const ICAL_METHOD_REQUEST = 'REQUEST';","    const ICAL_METHOD_PUBLISH = 'PUBLISH';","    const ICAL_METHOD_REPLY = 'REPLY';","    const ICAL_METHOD_ADD = 'ADD';","    const ICAL_METHOD_CANCEL = 'CANCEL';","    const ICAL_METHOD_REFRESH = 'REFRESH';","    const ICAL_METHOD_COUNTER = 'COUNTER';","    const ICAL_METHOD_DECLINECOUNTER = 'DECLINECOUNTER';","","    /**","     * Email priority.","     * Options: null (default), 1 = High, 3 = Normal, 5 = low.","     * When null, the header is not set at all.","     *","     * @var int|null","     */","    public $Priority;","","    /**","     * The character set of the message.","     *","     * @var string","     */","    public $CharSet = self::CHARSET_ISO88591;","","    /**","     * The MIME Content-type of the message.","     *","     * @var string","     */","    public $ContentType = self::CONTENT_TYPE_PLAINTEXT;","","    /**","     * The message encoding.","     * Options: \"8bit\", \"7bit\", \"binary\", \"base64\", and \"quoted-printable\".","     *","     * @var string","     */","    public $Encoding = self::ENCODING_8BIT;","","    /**","     * Holds the most recent mailer error message.","     *","     * @var string","     */","    public $ErrorInfo = '';","","    /**","     * The From email address for the message.","     *","     * @var string","     */","    public $From = '';","","    /**","     * The From name of the message.","     *","     * @var string","     */","    public $FromName = '';","","    /**","     * The envelope sender of the message.","     * This will usually be turned into a Return-Path header by the receiver,","     * and is the address that bounces will be sent to.","     * If not empty, will be passed via `-f` to sendmail or as the 'MAIL FROM' value over SMTP.","     *","     * @var string","     */","    public $Sender = '';","","    /**","     * The Subject of the message.","     *","     * @var string","     */","    public $Subject = '';","","    /**","     * An HTML or plain text message body.","     * If HTML then call isHTML(true).","     *","     * @var string","     */","    public $Body = '';","","    /**","     * The plain-text message body.","     * This body can be read by mail clients that do not have HTML email","     * capability such as mutt \u0026 Eudora.","     * Clients that can read HTML will view the normal Body.","     *","     * @var string","     */","    public $AltBody = '';","","    /**","     * An iCal message part body.","     * Only supported in simple alt or alt_inline message types","     * To generate iCal event structures, use classes like EasyPeasyICS or iCalcreator.","     *","     * @see https://kigkonsult.se/iCalcreator/","     *","     * @var string","     */","    public $Ical = '';","","    /**","     * Value-array of \"method\" in Contenttype header \"text/calendar\"","     *","     * @var string[]","     */","    protected static $IcalMethods = [","        self::ICAL_METHOD_REQUEST,","        self::ICAL_METHOD_PUBLISH,","        self::ICAL_METHOD_REPLY,","        self::ICAL_METHOD_ADD,","        self::ICAL_METHOD_CANCEL,","        self::ICAL_METHOD_REFRESH,","        self::ICAL_METHOD_COUNTER,","        self::ICAL_METHOD_DECLINECOUNTER,","    ];","","    /**","     * The complete compiled MIME message body.","     *","     * @var string","     */","    protected $MIMEBody = '';","","    /**","     * The complete compiled MIME message headers.","     *","     * @var string","     */","    protected $MIMEHeader = '';","","    /**","     * Extra headers that createHeader() doesn't fold in.","     *","     * @var string","     */","    protected $mailHeader = '';","","    /**","     * Word-wrap the message body to this number of chars.","     * Set to 0 to not wrap. A useful value here is 78, for RFC2822 section 2.1.1 compliance.","     *","     * @see static::STD_LINE_LENGTH","     *","     * @var int","     */","    public $WordWrap = 0;","","    /**","     * Which method to use to send mail.","     * Options: \"mail\", \"sendmail\", or \"smtp\".","     *","     * @var string","     */","    public $Mailer = 'mail';","","    /**","     * The path to the sendmail program.","     *","     * @var string","     */","    public $Sendmail = '/usr/sbin/sendmail';","","    /**","     * Whether mail() uses a fully sendmail-compatible MTA.","     * One which supports sendmail's \"-oi -f\" options.","     *","     * @var bool","     */","    public $UseSendmailOptions = true;","","    /**","     * The email address that a reading confirmation should be sent to, also known as read receipt.","     *","     * @var string","     */","    public $ConfirmReadingTo = '';","","    /**","     * The hostname to use in the Message-ID header and as default HELO string.","     * If empty, PHPMailer attempts to find one with, in order,","     * $_SERVER['SERVER_NAME'], gethostname(), php_uname('n'), or the value","     * 'localhost.localdomain'.","     *","     * @see PHPMailer::$Helo","     *","     * @var string","     */","    public $Hostname = '';","","    /**","     * An ID to be used in the Message-ID header.","     * If empty, a unique id will be generated.","     * You can set your own, but it must be in the format \"\u003cid@domain\u003e\",","     * as defined in RFC5322 section 3.6.4 or it will be ignored.","     *","     * @see https://www.rfc-editor.org/rfc/rfc5322#section-3.6.4","     *","     * @var string","     */","    public $MessageID = '';","","    /**","     * The message Date to be used in the Date header.","     * If empty, the current date will be added.","     *","     * @var string","     */","    public $MessageDate = '';","","    /**","     * SMTP hosts.","     * Either a single hostname or multiple semicolon-delimited hostnames.","     * You can also specify a different port","     * for each host by using this format: [hostname:port]","     * (e.g. \"smtp1.example.com:25;smtp2.example.com\").","     * You can also specify encryption type, for example:","     * (e.g. \"tls://smtp1.example.com:587;ssl://smtp2.example.com:465\").","     * Hosts will be tried in order.","     *","     * @var string","     */","    public $Host = 'localhost';","","    /**","     * The default SMTP server port.","     *","     * @var int","     */","    public $Port = 25;","","    /**","     * The SMTP HELO/EHLO name used for the SMTP connection.","     * Default is $Hostname. If $Hostname is empty, PHPMailer attempts to find","     * one with the same method described above for $Hostname.","     *","     * @see PHPMailer::$Hostname","     *","     * @var string","     */","    public $Helo = '';","","    /**","     * What kind of encryption to use on the SMTP connection.","     * Options: '', static::ENCRYPTION_STARTTLS, or static::ENCRYPTION_SMTPS.","     *","     * @var string","     */","    public $SMTPSecure = '';","","    /**","     * Whether to enable TLS encryption automatically if a server supports it,","     * even if `SMTPSecure` is not set to 'tls'.","     * Be aware that in PHP \u003e= 5.6 this requires that the server's certificates are valid.","     *","     * @var bool","     */","    public $SMTPAutoTLS = true;","","    /**","     * Whether to use SMTP authentication.","     * Uses the Username and Password properties.","     *","     * @see PHPMailer::$Username","     * @see PHPMailer::$Password","     *","     * @var bool","     */","    public $SMTPAuth = false;","","    /**","     * Options array passed to stream_context_create when connecting via SMTP.","     *","     * @var array","     */","    public $SMTPOptions = [];","","    /**","     * SMTP username.","     *","     * @var string","     */","    public $Username = '';","","    /**","     * SMTP password.","     *","     * @var string","     */","    public $Password = '';","","    /**","     * SMTP authentication type. Options are CRAM-MD5, LOGIN, PLAIN, XOAUTH2.","     * If not specified, the first one from that list that the server supports will be selected.","     *","     * @var string","     */","    public $AuthType = '';","","    /**","     * SMTP SMTPXClient command attributes","     *","     * @var array","     */","    protected $SMTPXClient = [];","","    /**","     * An implementation of the PHPMailer OAuthTokenProvider interface.","     *","     * @var OAuthTokenProvider","     */","    protected $oauth;","","    /**","     * The SMTP server timeout in seconds.","     * Default of 5 minutes (300sec) is from RFC2821 section 4.5.3.2.","     *","     * @var int","     */","    public $Timeout = 300;","","    /**","     * Comma separated list of DSN notifications","     * 'NEVER' under no circumstances a DSN must be returned to the sender.","     *         If you use NEVER all other notifications will be ignored.","     * 'SUCCESS' will notify you when your mail has arrived at its destination.","     * 'FAILURE' will arrive if an error occurred during delivery.","     * 'DELAY'   will notify you if there is an unusual delay in delivery, but the actual","     *           delivery's outcome (success or failure) is not yet decided.","     *","     * @see https://www.rfc-editor.org/rfc/rfc3461.html#section-4.1 for more information about NOTIFY","     */","    public $dsn = '';","","    /**","     * SMTP class debug output mode.","     * Debug output level.","     * Options:","     * @see SMTP::DEBUG_OFF: No output","     * @see SMTP::DEBUG_CLIENT: Client messages","     * @see SMTP::DEBUG_SERVER: Client and server messages","     * @see SMTP::DEBUG_CONNECTION: As SERVER plus connection status","     * @see SMTP::DEBUG_LOWLEVEL: Noisy, low-level data output, rarely needed","     *","     * @see SMTP::$do_debug","     *","     * @var int","     */","    public $SMTPDebug = 0;","","    /**","     * How to handle debug output.","     * Options:","     * * `echo` Output plain-text as-is, appropriate for CLI","     * * `html` Output escaped, line breaks converted to `\u003cbr\u003e`, appropriate for browser output","     * * `error_log` Output to error log as configured in php.ini","     * By default PHPMailer will use `echo` if run from a `cli` or `cli-server` SAPI, `html` otherwise.","     * Alternatively, you can provide a callable expecting two params: a message string and the debug level:","     *","     * ```php","     * $mail-\u003eDebugoutput = function($str, $level) {echo \"debug level $level; message: $str\";};","     * ```","     *","     * Alternatively, you can pass in an instance of a PSR-3 compatible logger, though only `debug`","     * level output is used:","     *","     * ```php","     * $mail-\u003eDebugoutput = new myPsr3Logger;","     * ```","     *","     * @see SMTP::$Debugoutput","     *","     * @var string|callable|\\Psr\\Log\\LoggerInterface","     */","    public $Debugoutput = 'echo';","","    /**","     * Whether to keep the SMTP connection open after each message.","     * If this is set to true then the connection will remain open after a send,","     * and closing the connection will require an explicit call to smtpClose().","     * It's a good idea to use this if you are sending multiple messages as it reduces overhead.","     * See the mailing list example for how to use it.","     *","     * @var bool","     */","    public $SMTPKeepAlive = false;","","    /**","     * Whether to split multiple to addresses into multiple messages","     * or send them all in one message.","     * Only supported in `mail` and `sendmail` transports, not in SMTP.","     *","     * @var bool","     *","     * @deprecated 6.0.0 PHPMailer isn't a mailing list manager!","     */","    public $SingleTo = false;","","    /**","     * Storage for addresses when SingleTo is enabled.","     *","     * @var array","     */","    protected $SingleToArray = [];","","    /**","     * Whether to generate VERP addresses on send.","     * Only applicable when sending via SMTP.","     *","     * @see https://en.wikipedia.org/wiki/Variable_envelope_return_path","     * @see https://www.postfix.org/VERP_README.html Postfix VERP info","     *","     * @var bool","     */","    public $do_verp = false;","","    /**","     * Whether to allow sending messages with an empty body.","     *","     * @var bool","     */","    public $AllowEmpty = false;","","    /**","     * DKIM selector.","     *","     * @var string","     */","    public $DKIM_selector = '';","","    /**","     * DKIM Identity.","     * Usually the email address used as the source of the email.","     *","     * @var string","     */","    public $DKIM_identity = '';","","    /**","     * DKIM passphrase.","     * Used if your key is encrypted.","     *","     * @var string","     */","    public $DKIM_passphrase = '';","","    /**","     * DKIM signing domain name.","     *","     * @example 'example.com'","     *","     * @var string","     */","    public $DKIM_domain = '';","","    /**","     * DKIM Copy header field values for diagnostic use.","     *","     * @var bool","     */","    public $DKIM_copyHeaderFields = true;","","    /**","     * DKIM Extra signing headers.","     *","     * @example ['List-Unsubscribe', 'List-Help']","     *","     * @var array","     */","    public $DKIM_extraHeaders = [];","","    /**","     * DKIM private key file path.","     *","     * @var string","     */","    public $DKIM_private = '';","","    /**","     * DKIM private key string.","     *","     * If set, takes precedence over `$DKIM_private`.","     *","     * @var string","     */","    public $DKIM_private_string = '';","","    /**","     * Callback Action function name.","     *","     * The function that handles the result of the send email action.","     * It is called out by send() for each email sent.","     *","     * Value can be any php callable: https://www.php.net/is_callable","     *","     * Parameters:","     *   bool $result           result of the send action","     *   array   $to            email addresses of the recipients","     *   array   $cc            cc email addresses","     *   array   $bcc           bcc email addresses","     *   string  $subject       the subject","     *   string  $body          the email body","     *   string  $from          email address of sender","     *   string  $extra         extra information of possible use","     *                          \"smtp_transaction_id' =\u003e last smtp transaction id","     *","     * @var string","     */","    public $action_function = '';","","    /**","     * What to put in the X-Mailer header.","     * Options: An empty string for PHPMailer default, whitespace/null for none, or a string to use.","     *","     * @var string|null","     */","    public $XMailer = '';","","    /**","     * Which validator to use by default when validating email addresses.","     * May be a callable to inject your own validator, but there are several built-in validators.","     * The default validator uses PHP's FILTER_VALIDATE_EMAIL filter_var option.","     *","     * If CharSet is UTF8, the validator is left at the default value,","     * and you send to addresses that use non-ASCII local parts, then","     * PHPMailer automatically changes to the 'eai' validator.","     *","     * @see PHPMailer::validateAddress()","     *","     * @var string|callable","     */","    public static $validator = 'php';","","    /**","     * An instance of the SMTP sender class.","     *","     * @var SMTP","     */","    protected $smtp;","","    /**","     * The array of 'to' names and addresses.","     *","     * @var array","     */","    protected $to = [];","","    /**","     * The array of 'cc' names and addresses.","     *","     * @var array","     */","    protected $cc = [];","","    /**","     * The array of 'bcc' names and addresses.","     *","     * @var array","     */","    protected $bcc = [];","","    /**","     * The array of reply-to names and addresses.","     *","     * @var array","     */","    protected $ReplyTo = [];","","    /**","     * An array of all kinds of addresses.","     * Includes all of $to, $cc, $bcc.","     *","     * @see PHPMailer::$to","     * @see PHPMailer::$cc","     * @see PHPMailer::$bcc","     *","     * @var array","     */","    protected $all_recipients = [];","","    /**","     * An array of names and addresses queued for validation.","     * In send(), valid and non duplicate entries are moved to $all_recipients","     * and one of $to, $cc, or $bcc.","     * This array is used only for addresses with IDN.","     *","     * @see PHPMailer::$to","     * @see PHPMailer::$cc","     * @see PHPMailer::$bcc","     * @see PHPMailer::$all_recipients","     *","     * @var array","     */","    protected $RecipientsQueue = [];","","    /**","     * An array of reply-to names and addresses queued for validation.","     * In send(), valid and non duplicate entries are moved to $ReplyTo.","     * This array is used only for addresses with IDN.","     *","     * @see PHPMailer::$ReplyTo","     *","     * @var array","     */","    protected $ReplyToQueue = [];","","    /**","     * Whether the need for SMTPUTF8 has been detected. Set by","     * preSend() if necessary.","     *","     * @var bool","     */","    public $UseSMTPUTF8 = false;","","    /**","     * The array of attachments.","     *","     * @var array","     */","    protected $attachment = [];","","    /**","     * The array of custom headers.","     *","     * @var array","     */","    protected $CustomHeader = [];","","    /**","     * The most recent Message-ID (including angular brackets).","     *","     * @var string","     */","    protected $lastMessageID = '';","","    /**","     * The message's MIME type.","     *","     * @var string","     */","    protected $message_type = '';","","    /**","     * The array of MIME boundary strings.","     *","     * @var array","     */","    protected $boundary = [];","","    /**","     * The array of available text strings for the current language.","     *","     * @var array","     */","    protected $language = [];","","    /**","     * The number of errors encountered.","     *","     * @var int","     */","    protected $error_count = 0;","","    /**","     * The S/MIME certificate file path.","     *","     * @var string","     */","    protected $sign_cert_file = '';","","    /**","     * The S/MIME key file path.","     *","     * @var string","     */","    protected $sign_key_file = '';","","    /**","     * The optional S/MIME extra certificates (\"CA Chain\") file path.","     *","     * @var string","     */","    protected $sign_extracerts_file = '';","","    /**","     * The S/MIME password for the key.","     * Used only if the key is encrypted.","     *","     * @var string","     */","    protected $sign_key_pass = '';","","    /**","     * Whether to throw exceptions for errors.","     *","     * @var bool","     */","    protected $exceptions = false;","","    /**","     * Unique ID used for message ID and boundaries.","     *","     * @var string","     */","    protected $uniqueid = '';","","    /**","     * The PHPMailer Version number.","     *","     * @var string","     */","    const VERSION = '6.10.0';","","    /**","     * Error severity: message only, continue processing.","     *","     * @var int","     */","    const STOP_MESSAGE = 0;","","    /**","     * Error severity: message, likely ok to continue processing.","     *","     * @var int","     */","    const STOP_CONTINUE = 1;","","    /**","     * Error severity: message, plus full stop, critical error reached.","     *","     * @var int","     */","    const STOP_CRITICAL = 2;","","    /**","     * The SMTP standard CRLF line break.","     * If you want to change line break format, change static::$LE, not this.","     */","    const CRLF = \"\\r\\n\";","","    /**","     * \"Folding White Space\" a white space string used for line folding.","     */","    const FWS = ' ';","","    /**","     * SMTP RFC standard line ending; Carriage Return, Line Feed.","     *","     * @var string","     */","    protected static $LE = self::CRLF;","","    /**","     * The maximum line length supported by mail().","     *","     * Background: mail() will sometimes corrupt messages","     * with headers longer than 65 chars, see #818.","     *","     * @var int","     */","    const MAIL_MAX_LINE_LENGTH = 63;","","    /**","     * The maximum line length allowed by RFC 2822 section 2.1.1.","     *","     * @var int","     */","    const MAX_LINE_LENGTH = 998;","","    /**","     * The lower maximum line length allowed by RFC 2822 section 2.1.1.","     * This length does NOT include the line break","     * 76 means that lines will be 77 or 78 chars depending on whether","     * the line break format is LF or CRLF; both are valid.","     *","     * @var int","     */","    const STD_LINE_LENGTH = 76;","","    /**","     * Constructor.","     *","     * @param bool $exceptions Should we throw external exceptions?","     */","    public function __construct($exceptions = null)","    {","        if (null !== $exceptions) {","            $this-\u003eexceptions = (bool) $exceptions;","        }","        //Pick an appropriate debug output format automatically","        $this-\u003eDebugoutput = (strpos(PHP_SAPI, 'cli') !== false ? 'echo' : 'html');","    }","","    /**","     * Destructor.","     */","    public function __destruct()","    {","        //Close any open SMTP connection nicely","        $this-\u003esmtpClose();","    }","","    /**","     * Call mail() in a safe_mode-aware fashion.","     * Also, unless sendmail_path points to sendmail (or something that","     * claims to be sendmail), don't pass params (not a perfect fix,","     * but it will do).","     *","     * @param string      $to      To","     * @param string      $subject Subject","     * @param string      $body    Message Body","     * @param string      $header  Additional Header(s)","     * @param string|null $params  Params","     *","     * @return bool","     */","    private function mailPassthru($to, $subject, $body, $header, $params)","    {","        //Check overloading of mail function to avoid double-encoding","        if ((int)ini_get('mbstring.func_overload') \u0026 1) {","            $subject = $this-\u003esecureHeader($subject);","        } else {","            $subject = $this-\u003eencodeHeader($this-\u003esecureHeader($subject));","        }","        //Calling mail() with null params breaks","        $this-\u003eedebug('Sending with mail()');","        $this-\u003eedebug('Sendmail path: ' . ini_get('sendmail_path'));","        $this-\u003eedebug(\"Envelope sender: {$this-\u003eSender}\");","        $this-\u003eedebug(\"To: {$to}\");","        $this-\u003eedebug(\"Subject: {$subject}\");","        $this-\u003eedebug(\"Headers: {$header}\");","        if (!$this-\u003eUseSendmailOptions || null === $params) {","            $result = @mail($to, $subject, $body